import React from "react";
import axios from 'axios';




function Astro(){

  let astroData =[];
  console.log(astroData);
  const axios = require('axios');

  async function getData() {
      try {
        const response = await axios.get('https://api.openweathermap.org/data/2.5/onecall?lat=33.578477&lon=-84.340117&units=imperial&appid=96203ae9ca7ca6287795be6c0d2ca9be');
        console.log(response);
        astroData=[response.data.current.sunrise,response.data.current.sunset,response.data.daily[0].moonrise,response.data.daily[0].moonset,response.data.daily[0].moon_phase];

        console.log(astroData);
      } catch (error) {
        console.error(error);
      }
    }
    console.log(astroData);

    return(

        <section>
             <article>
             <h1>Astrological Events</h1>
             <img src= {<Astro/>} ></img>
             <strong>Sunrise:</strong> <p>{astroData[0]}</p>
             <strong>Sunset:</strong> <p>{astroData[1]}</p>
            <strong>Moonrise:</strong> <p>{astroData[2]}</p>
            <strong>Moonset:</strong> <p>{astroData[3]}</p>
            <strong>Moon Phase:</strong> <p>{astroData[4]}</p>


        </article>

        </section>
    )
}
export default Astro;
